import React from 'react'; 
import {StyleSheet, TouchableOpacity, Text, View, ViewBase} from 'react-native';

export default function FlatButton({text, onPress}) {
    return(
        <TouchableOpacity onpress={onPress}>
            <View style={styles.button}> 

                <Text stule={styles.buttonText}> {text} </Text>

            </View>
        </TouchableOpacity>

    )
}

const styles= StyleSheet.create({
    button: {
        borderRadius: 8, 
        paddingVertical: 14, 
        paddingHorizontal: 10, 
        backgroundColor: 'black',
    },

    buttonText: {
        color: 'white',
        fontWeight: 'bold', 
        textTransform: 'uppercase', 
        fontSize: 16, 
        textAlign: 'center',
    },


})
